import React from 'react'
import Tea from './Tea'
import {Route, Link} from 'react-route-dom'

 const Teas = (props)=> {
    //  console.log(props)
     return(
    <div>
       {props.teas.map(tea => 
        <div key={tea.id}><link path={ `/teas/${tea.id}`}>{tea.name} {tea.brand} {tea.description}</link> <Tea tea= {tea}/> </div>   )}

         </div>
     )


 }

 export default Teas
